import logo from "./logo.svg";
import "./App.css";
import { Redirect, Route } from "react-router";
import Welcome from "./Components/Welcome/Welcome";
import Logout from "./Components/Logout/Logout";
import Login from "./Components/Login/Login";

function App() {
  return (
    <div className="App">
      <Switch>
        <Route path="/" exact>
          <Redirect to="/Welcome" />
        </Route>

        <Route path="/Welcome">
          <Welcome />
        </Route>

        <Route path="/Login">
          <Login />
        </Route>
        <Route path="/Logout">
          <Logout />
        </Route>
      </Switch>
    </div>
  );
}

export default App;
